                    left: 0;
                    width: 100%;
                    height: 100px;
                    background: white;
                    box-shadow: ${Theme.sh.mat};
                }
            `}</style>
        </div>
    )
}

function Layout() {
    return (
        <div id='layout'>
            <Navigation></Navigation>
            <style jsx global>{`
                #__next {
                    padding: 0;
                    margin: 0;
                }
                body {
                    padding: 0;
                    margin: 0;
                    width: 100%;
                    height: 100%;
                    margin-top: 100px;
                }
            `}</style>
        </div>
    )
}

export default Layout
